// App.js
import React, { useState } from 'react';
import LoginForm from './components/Loginform';
import Reminders from './components/Reminders';
import ReminderDetail from './components/ReminderDetail';

function App() {
  const [isLoggedIn, setIsLoggedIn] = useState(false);
  const [selectedReminderId, setSelectedReminderId] = useState(null);

  // Callback function to handle login success
  const handleLoginSuccess = () => {
    setIsLoggedIn(true);
  };

  // Callback function to handle reminder selection
  const handleReminderClick = (id) => {
    setSelectedReminderId(id);
  };

  return (
    <div>
      {!isLoggedIn ? (
        <LoginForm onLoginSuccess={handleLoginSuccess} />
      ) : selectedReminderId ? (
        <ReminderDetail reminderId={selectedReminderId} />
      ) : (
        <Reminders onReminderClick={handleReminderClick} />
      )}
    </div>
  );
}

export default App;
